import React, { useState } from "react";

const callPlayerUp = async (value) => {
    const encoded = encodeURIComponent(value)
    const fetching = await fetch(`http://lookup-service-prod.mlb.com/json/named.search_player_all.bam?sport_code='mlb'&active_sw='Y'&name_part='${encoded}%25'`)
    const newplayer = await fetching.json();
    console.log('calling up... ', newplayer)
    return newplayer
    // .search_player_all.queryResults.row.name_display_first_last
}
